import React from 'react'

export default function Adfar() {
    const mystylediv = {
        height:"200px",
        width:"300px",
        backgroundColor:"gray"
    }
    const mystyleh1 = {
        color:"red",
        backgroundColor:"green"
    }
    const mtsytleh3 = {border:"2px solid red"}
  return (
    <div style={mystylediv}>
    <h1 style={mystyleh1}>Adfar Rasheed</h1>
    <h3 style={mtsytleh3}>Blackbucks</h3>
  </div>
  )
}
